import React from 'react'
import phonee from "../../../Image/phonee.svg";


const Description = () => {
    return ( 
        <div className="container">
        <div className="row">
            <div className="col">
                <div className="row">
                <div className="col-lg">
                    <img src={phonee} alt="" width="100"/>
                </div>
                </div>
            </div>
        </div>
        </div>
     );
}

export default Description;
